import React from 'react';
import img1 from './Images/img1.png';
const Home = ()=>{
    return(
        <>
        <br/>
        <br/>
        <br/>
       <div className='main-div'>
        <div className="container align-items-center justify-content-center ">
            <img src={img1} alt='img1..' className="ban-img mx-auto"/>
        </div>
       </div>
        
        </>
    );
};
export default Home;
